# CSCB58 Summer 2024 Assembly Final Project - UTSC
# Student1: Valdy Oktavian, 1010238315, oktavia1, valdy.oktavian@mail.utoronto.ca
#
#
# Bitmap Display Configuration:
# - Unit width in pixels: 4 (update this as needed)
# - Unit height in pixels: 4 (update this as needed)
# - Display width in pixels: 128 (update this as needed)
# - Display height in pixels: 256 (update this as needed)
# - Base Address for Display: 0x10008000 ($gp)
#
# Which milestones have been reached in this submission?
# (See the assignment handout for descriptions of the milestones)
# - Milestone 5 (choose the one the applies)
#
# Which approved features have been implemented? "use numbers from the handout"
# (See the assignment handout for the list of features)
# Easy Features:
# 1. Implement gravity
# 2. All tetrominos different colours
# 3. Paused + screen + pressing p will resume
# 4. Gravity gradually increases as score increases
# 5. Gameover screen with a retry option
# 6. Track and display highscore
# 7. Outline where piece will drop
# 8. Preview next piece
# 9. Preview 4 of next pieces
# 10. Allow user to hold/save the tetromino 
# Hard Features:
# 1. Implement full set of tetrominos
# 2. Keep track of score
# 3. Plays the tetris theme song as you play
# How to play:
# (Include any instructions)
# 1. Open the bitmap display from tool bar
# 2. Set the dimensions according to the bitmap configuration below. If the screen does not fit, reduce the pixel size and dimensions of screen with same aspect ratio
# 3. Set the base address for display to $gp 
# 4. Connect the display
# 5. Open the keyboard and display MMIO simulator from tool bar
# 6. Connect the keyboard
# 7. Assemble the code and execute it
# 8. Click 's' to start game
# 9. CONTROLS:
#    - a : go left one block
#    - d : go right one block
#    - s : go down one block
#    - w : rotate 90 degrees
#    - h : hold / save current block
#    - q : quit game
#    - space: drop block to bottom instantly
#    - p : pause screen
# Link to video demonstration for final submission:Learn more
# - https://youtu.be/ejOCmDZpaOU?si=jw4654zOYEQUKql3
#
# Are you OK with us sharing the video with people outside course staff?
# - yes 
#
# Any additional information that the TA needs to know:
# - Observe the joystick on the bottom of the screen.
# - For Music Settings, go to Line 184 or Ctrl + F( Find: "Music Settings")
#   Four different settings available.
#   High Specs (tested on ASUS Strix G14 2024)
#   Very High Specs
#   Medium Specs
#   Low Specs (tested on BV Lab Computer)
# - If None of the above settings works for you, then feel free to set the volume to 0 below.
.eqv VOLUME 20
