func_drawPartialScreen:
	# Arguments: X, Y, width, height
	# Load from screen
	la $t0, screen
	
	lw $t7, 12($sp) # get StartX
	lw $t8, 8($sp) # get StartY
	lw $t4, 4($sp) # get width
	lw $t3, 0($sp) # get height
	addi $sp, $sp, 16
	
	# set strat_x and strat_y
	move $t2, $t7
	move $t1, $t8
	
	# set end_x and end_y
	add $t4, $t4, $t2
	add $t3, $t3, $t1
	
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	sw $t7, -4($sp)
	addi $sp, $sp, -4
	
	
	for_loop_drawPartialScreen_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		move $t2, $t7
	for_loop_drawPartialScreen_j: 
		li $t5, WIDTH
		mult $t1, $t5 # i*25
		mflo $t5 # store in $t5
		add $t5, $t5, $t2 # i*25 + j
		mult $t5, $t9 #(i*25 + j) * 4
		mflo $t5 # store in $t5
		add $t5, $t0, $t5 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]

		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		li $a2, BASE_ADDRESS
		#store the current pc
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		#put the before pc to ra
		lw $ra, 0($sp)
		addi $sp, $sp, 4		
		
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1 # j = j + 1
		blt $t2, $t4, for_loop_drawPartialScreen_j
	end_loop_drawPartialScreen_j:
	#change the y = y + 1
	addi $t8, $t8, 1
	#change i = i + 1
	addi $t1, $t1, 1
	blt $t1, $t3, for_loop_drawPartialScreen_i
	end_loop_drawPartialScreen_i:
	
	
	addi $sp, $sp, 4
	jr $ra
end_func_drawPartialScreen:

func_drawTetrominoAfterMoveOnScreen:

	lw $t2, 8($sp) #x
	lw $t3, 4($sp) #y
	lw $t7, 0($sp) #direection
	addi $sp, $sp, 12
	
	
	li $t5, TETROMINO_SIZE #width
	li $t6, TETROMINO_SIZE #height
	
	beq $t7, 0, drawTetrominoMoveDown
	beq $t7, 1, drawTetrominoMoveLeft
	beq $t7, 2, drawTetrominoMoveRight
	j call_drawPartial #ELSE
	
	drawTetrominoMoveDown:
	
	addi $t6, $t6, TETROMINO_BLOCK_SIZE
	addi $t3, $t3, -TETROMINO_BLOCK_SIZE
	j call_drawPartial
	
	drawTetrominoMoveLeft:
	addi $t5, $t5, TETROMINO_BLOCK_SIZE
	j call_drawPartial
	
	drawTetrominoMoveRight:
	addi $t5, $t5, TETROMINO_BLOCK_SIZE
	addi $t2, $t2, -TETROMINO_BLOCK_SIZE
	j call_drawPartial
	
	
	call_drawPartial:
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #width
	sw $t6, -16($sp) #height
	addi $sp, $sp, -16
	jal func_drawPartialScreen
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
func_drawDarkenScreen:
	li $t8, 0 #y
	li $t7, 0 #x
	la $t0, screen
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, WIDTH
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	lw $s3, 0($sp) # s3: Darken constant
	addi $sp, $sp, 4
	for_loop_drawDarkenScreen_i:
		# address is (j,i)
		li $t7, 0
		# y = y + 1
		li $t2, 0
	for_loop_drawDarkenScreen_j: 
		mult $t1, $t4 # i*25
		mflo $t3 # store in $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3 # store in $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]
		# ---------------- DARKEN T5 -------------------
		
		
		
		# Load the original color into a register
   		andi $s4, $t5, 0xFF000000
		andi $s5, $t5, 0x00FF0000
		andi $s6, $t5, 0x0000FF00
		andi $s7, $t5, 0x000000FF
		
		# Shift right to get the RR, GG, BB
		srl $s5, $s5, 16
		srl $s6, $s6, 8
		
		# RR/2, GG/2, BB/2
		div $s5, $s3
		mflo $s5
		
		div $s6, $s3
		mflo $s6
		
		div $s7, $s3
		mflo $s7
		
		# Shift left RR, GG, BB to original position
		sll $s5, $s5, 16
		sll $s6, $s6, 8
		
		# Or to combine
		or $s4, $s4, $s5
		or $s4, $s4, $s6
		or $s4, $s4, $s7
		
		# t5 = new color
		move $t5, $s4
		# ----------------------------------------------
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		li $a2, BASE_ADDRESS
		#store the current pc
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		
		# draw to $v0
		sw $t5, 0($v0)
		
		#put the before pc to ra
		lw $ra, 0($sp)
		addi $sp, $sp, 4		
		
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1 # j = j + 1
		blt $t2, $t4, for_loop_drawDarkenScreen_j
	end_loop_drawDarkenScreen_j:
	#change the y = y + 1
	addi $t8, $t8, 1
	#change i = i + 1
	addi $t1, $t1, 1
	blt $t1, HEIGHT, for_loop_drawDarkenScreen_i
	end_loop_drawDarkenScreen_i:
	
	jr $ra
end_func_drawDarkenScreen:

func_drawPauseScreen:
	# Takes a0 as source of screen (pause screen address)
	li $t8, 0 #y
	li $t7, 0 #x
	move $t0, $a0
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, WIDTH
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	#store the current pc
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	jal func_saveAllRegisters
	li $t0, 3
	sw $t0, -4($sp)
	addi $sp, $sp, -4
	jal func_drawDarkenScreen
	jal func_loadAllRegisters
	
	for_loop_drawPauseScreen_i:
		# address is (j,i)
		li $t7, 0
		# y = y + 1
		li $t2, 0
	for_loop_drawPauseScreen_j: 
		mult $t1, $t4 # i*25
		mflo $t3 # store in $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3 # store in $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]
		
		# SKIP COLOR IF 0X00000000
		beq $t5, 0x00000000, skip_drawPauseScreen
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		li $a2, BASE_ADDRESS
		
		jal func_gotoxy
		
	
		# draw to $v0
		sw $t5, 0($v0)
		
				
		skip_drawPauseScreen:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1 # j = j + 1
		blt $t2, $t4, for_loop_drawPauseScreen_j
	end_loop_drawPauseScreen_j:
	#change the y = y + 1
	addi $t8, $t8, 1
	#change i = i + 1
	addi $t1, $t1, 1
	blt $t1, HEIGHT, for_loop_drawPauseScreen_i
	end_loop_drawPauseScreen_i:
	
	#put the before pc to ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
end_func_drawPauseScreen:

