func_drawBlockatXY:
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #4
	
	for_loop_drawblock_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		
		
		li $t2, 0
	for_loop_drawblock_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_drawBlock
		beq $t5, SKIP_COLOR_2, skip_drawBlock
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2,screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
	skip_drawBlock:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, $t4, for_loop_drawblock_j
	end_loop_drawblock_j:
	
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, $t4, for_loop_drawblock_i
	end_loop_drawblock_i:
	
	addi $sp, $sp, 4
	jr $ra
