func_deleteBlockatXY:
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #4
	
	for_loop_deleteblock_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		li $t2, 0
	for_loop_deleteblock_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_deleteBlock
		beq $t5, SKIP_COLOR_2, skip_deleteBlock
		
		# Change the color at $t5
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2, screen_base 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		lw $t5, 0($v0)
		
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2, screen 
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
	skip_deleteBlock:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, $t4, for_loop_deleteblock_j
	end_loop_deleteblock_j:
	
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, $t4, for_loop_deleteblock_i
	end_loop_deleteblock_i:
	
	addi $sp, $sp, 4
	jr $ra
end_func_deleteBlock:


respond_to_a:

	jal func_deletePrediction
	jal func_saveAllRegisters
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_checkCollisionLeft
	jal func_loadAllRegisters
	
	beq $v0, 1, end_respond_to_a
	
	# START: Call delete block
	jal func_saveAllRegisters
	
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	
	jal func_deleteBlockatXY
	
	jal func_loadAllRegisters
	# END: Call delete block
	
	
	addi $t2, $t2, -TETROMINO_BLOCK_SIZE
	
	# START: Draw Tetromino on Abstract Screen
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Tetromino After Moving Left
	jal func_saveAllRegisters
	li $t5, 1 # Direction: Left
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Left
	
	# START: Draw Joystick on Abstract Screen
	jal func_saveAllRegisters
	la $t5, joystick_left
	li $t2, JOYSTICK_STARTX
	li $t3, JOYSTICK_STARTY
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Joystick After Moving Left
	jal func_saveAllRegisters
	li $t5, 69 # Direction: None
	li $t2, JOYSTICK_STARTX
	li $t3, JOYSTICK_STARTY
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Joystick After Moving Left
	
end_respond_to_a:
	
	jal func_predictAndDrawPrediction
	j end_keypress
	
	

respond_to_w: #rotate
	jal func_deletePrediction
	jal func_saveAllRegisters
	
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	
	jal func_deleteBlockatXY
	
	jal func_loadAllRegisters
	
	#START - ROTATE
	jal func_saveAllRegisters
	jal func_getNextRotation
	jal func_loadAllRegisters
	#END - ROTATE
	move $t5, $v0
	
	# START: Draw Tetromino on Abstract Screen
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Tetromino After Moving Nowhere
