#FUNCTION NOW
func_hold:
	# START: Call delete block
	jal func_saveAllRegisters
	
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	
	jal func_deleteBlockatXY
	
	jal func_loadAllRegisters
	# END: Call delete block

	
	# START: Draw Tetromino After Hold
	jal func_saveAllRegisters
	li $t5, 69 # Direction: None
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Hold
	
	bne $t6, 0, hold_switch
	
 	jal func_deletePrediction
	move $t6, $t5
	
	move $a0, $t6
	jal func_determineBaseTetromino
	move $t6, $v0
	
	# START: Draw hold on Abstract Screen
	jal func_saveAllRegisters
	li $t2, HOLD_START_X
	li $t3, HOLD_START_Y
	
	la $s6, lightblue_tetromino_1
	beq $t6, $s6, instant_drawHold
	
	la $s6,  yellow_tetromino
	beq $t6, $s6, instant_drawHold
	# IF NOT YELLOW OR BLUE, THEN PPRINT IT OFFSET 4
	addi $t2, $t2, 2
	instant_drawHold:
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t6, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Hold 
	jal func_saveAllRegisters
	li $t5, 69 # Direction: None
	li $t2, HOLD_START_X
	li $t3, HOLD_START_Y
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t6, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Down
	#place and create new one
	
	j func_placeAndCreate
	
hold_switch:

 	jal func_deletePrediction
	move $s6, $t6
	move $t6, $t5
	move $t5, $s6
	
	move $a0, $t6
	jal func_determineBaseTetromino
	move $t6, $v0
	
	li $s5, 0
	la $s6, hold_boolean
	sw $s5, 0($s6)
	
	j func_place
	
cannot_switch:
	move $s6, $t6
	move $t6, $t5
	move $t5, $s6
	
	li $s5, 1
	la $s6, hold_boolean
	sw $s5, 0($s6)
	j end_respond_to_h
end_func_hold:

