	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Down

	
	# START - CHECK IF BOTTOM COLLIDE
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_checkCollisionBottom
	jal func_loadAllRegisters

	beq $v0, 1, func_placeAndCreate
	# END - CHECK IF BOTTOM COLLIDE
	
	
	# START - DELETE THE BLOCK
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	# END
	
		
	
	addi $t3, $t3, TETROMINO_BLOCK_SIZE
	
	# HANDLE MUSIC
	jal func_saveAllRegisters
	jal func_handleMusic
	jal func_loadAllRegisters
	
	skip_handleMusic:
	j loop_predictWhereToDrop_start
	
loop_predictWhereToDrop_end:
		
	
func_checkCollisionLeft: 
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8

	li $t1, 2 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #4
	
	for_loop_checkCollisionLeft_i:
		# address is (j,i)
		lw $t7, 0($sp) # set X to startX	
		li $t2, 0
	for_loop_checkCollisionLeft_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_checkCollisionLeft
		beq $t5, SKIP_COLOR_2, skip_checkCollisionLeft
		beq $t2, 0, check_checkCollisionLeft
		
		add $t5, $t0, $t3 # t5 = address of arr[index]
		addi $t5, $t5, -4  # t5 = address of arr[index-1]
		lw $t5, 0($t5)# t5 = arr[index-1]
		
		bne $t5, SKIP_COLOR, skip_checkCollisionLeft
		#x = x-1
		
check_checkCollisionLeft:
		addi $t7, $t7, -1
		
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2,screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		
		addi $t7, $t7, 1
		
		lw $t5, 0($v0)
		bne $t5, SKIP_COLOR_2, return_checkCollisionLeft_true
		
	skip_checkCollisionLeft:
		addi $t7, $t7, 4 # x = x + 4
		addi $t2, $t2, 4
		blt $t2, $t4, for_loop_checkCollisionLeft_j
	end_loop_checkCollisionLeft_j:
	
	addi $t8, $t8, 4
	addi $t1, $t1, 4
	blt $t1, $t4, for_loop_checkCollisionLeft_i
	end_loop_checkCollisionLeft_i:
	
return_checkCollisionLeft_false:
	addi $sp, $sp, 4
	li $v0, 0
	jr $ra
return_checkCollisionLeft_true:
	addi $sp, $sp, 4
	li $v0, 1
	jr $ra
end_func_checkCollisionLeft:

func_checkCollisionRight: 
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	li $t1, 2 # i 
	li $t2, 3 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #4
	
	for_loop_checkCollisionRight_i:
		# address is (j,i)
		lw $t7, 0($sp) # set X to startX	
		addi $t7, $t7, 3
		li $t2, 3
	for_loop_checkCollisionRight_j: 
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_checkCollisionRight
		beq $t5, SKIP_COLOR_2, skip_checkCollisionRight
		beq $t2, 15, check_checkCollisionRight
		
		add $t5, $t0, $t3 # t5 = address of arr[index]
		addi $t5, $t5, 4  # t5 = address of arr[index+1]
		lw $t5, 0($t5)# t5 = arr[index+1]
		
		bne $t5, SKIP_COLOR, skip_checkCollisionRight
		#x = x-1
		
check_checkCollisionRight:
		addi $t7, $t7, 1
		
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2,screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		
		addi $t7, $t7, -1
		
		lw $t5, 0($v0)
		
		bne $t5, SKIP_COLOR_2, return_checkCollisionRight_true
		
	skip_checkCollisionRight:
		addi $t7, $t7, 4 # x = x + 4
		addi $t2, $t2, 4
		blt $t2, $t4, for_loop_checkCollisionRight_j
	end_loop_checkCollisionRight_j:
	
	addi $t8, $t8, 4
	addi $t1, $t1, 4
	blt $t1, $t4, for_loop_checkCollisionRight_i
	end_loop_checkCollisionRight_i:
	
	
return_checkCollisionRight_false:
	addi $sp, $sp, 4
	li $v0, 0
	jr $ra
return_checkCollisionRight_true:
	addi $sp, $sp, 4
	li $v0, 1
	jr $ra
	
end_func_checkCollisionRight:

func_checkCollisionBottom:
	lw $t0, 0 ($sp) # address 
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	li $t1, 3 # i 
	li $t2, 2 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #4
	addi $t8, $t8, 3 #set y to y + 3
	for_loop_checkCollisionBottom_i:
		# address is (j,i)
		lw $t7, 0($sp) # set X to startX	
		addi $t7, $t7, 2 #startX + 2
		li $t2, 2
	for_loop_checkCollisionBottom_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*WIDTH + j
		mult $t3, $t9 #(i*WIDTH + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of tetromino_red[index]
		
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_checkCollisionBottom
		beq $t5, SKIP_COLOR_2, skip_checkCollisionBottom
		beq $t1, 15, check_checkCollisionBottom
		
		
		add $t5, $t0, $t3 # t5 = address of arr[index]
		addi $t5, $t5, TETROMINO_SIZE_TIMES_4 # t5 = address of arr[index+TETROMINO]
		lw $t5, 0($t5)# t5 = arr[index+WIDTH]
		
		bne $t5, SKIP_COLOR, skip_checkCollisionBottom
		
check_checkCollisionBottom:
		
		addi $t8, $t8, 1
		
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2, screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		
		addi $t8, $t8, -1
		
		lw $t5, 0($v0)
		
		bne $t5, SKIP_COLOR_2, return_checkCollisionBottom_true
	skip_checkCollisionBottom:
		addi $t7, $t7, 4 # x = x + 4
		addi $t2, $t2, 4
		blt $t2, $t4, for_loop_checkCollisionBottom_j
	end_loop_checkCollisionBottom_j:
	
	addi $t8, $t8, 4
	addi $t1, $t1, 4
	blt $t1, $t4, for_loop_checkCollisionBottom_i
	end_loop_checkCollisionBottom_i:
	
return_checkCollisionBottom_false:
	addi $sp, $sp, 4
	li $v0, 0
	jr $ra
return_checkCollisionBottom_true:
	addi $sp, $sp, 4
	li $v0, 1
	jr $ra
	
end_func_checkCollisionBottom:

# a0: old tetromino address a1: new_tetromino address
# You have $t2, $t3 as starting points x and y
# This function returns 1 if the new_tetromino overlaps with the background on screen (NOT INCLUDING THE OLD TETROMINO)
func_checkOverlap:

move $s2, $t2 # I need to use $t2 for other stuff 
move $s3, $t3

move $s5, $a0
move $s6, $a1

li $t6, 0 #i
li $t7, 0 #j
li $t4, TETROMINO_SIZE
li $t8, WIDTH
li $t9, 4
# SCREEN + ((startY + i) * WIDTH + startX + j) * 4 => address of (stARTx + j, starty + i) on screen
loop_start_checkOverlap_i:
li $t7, 0

loop_start_checkOverlap_j:
# count index for tetromino
# index = (i * tetromino_size + j) * 4
	mult $t6, $t4
	mflo $t3 # i*TETROMINO_SIZE
	add $t3, $t3, $t7 # i*TETROMINO_SIZE + j
	mult $t3, $t9 
	mflo $t3 #(i*TETROMINO_SZE + j) * 4
	add $t5, $s5, $t3 # t5 = address of tetromino_OLD[index]
	lw $t5, 0($t5) # t5 = tetromino_OLD[index]
# Check if OLD is colorful
	bne $t5, SKIP_COLOR, skip_checkOverlap

	add $t5, $s6, $t3 # t5 = address of tetromino_red_NOW[index]
	lw $t5, 0($t5) # t5 = tetromino_red_NEW[index]
	beq $t5, SKIP_COLOR, skip_checkOverlap
	
	# Check for screen
	add $t0, $s2, $t7 # y = startX + j
	add $t1, $s3, $t6 # y = startY + i
	
	move $a0, $t0
	move $a1, $t1
	la $a2, screen
	
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	jal func_gotoxy
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	lw $t5, 0($v0)
	beq $t5, SKIP_COLOR, skip_checkOverlap
	beq $t5, SKIP_COLOR_2, skip_checkOverlap
	beq $t5, SKIP_COLOR_4, skip_checkOverlap
	li $v0, 1
	jr $ra

skip_checkOverlap:

addi $t7, $t7, 1
blt $t7, TETROMINO_SIZE, loop_start_checkOverlap_j
loop_end_checkOverlap_j:


addi $t6, $t6, 1
blt $t6, TETROMINO_SIZE, loop_start_checkOverlap_i
loop_end_checkOverlap_i:

li $v0, 0
jr $ra

