func_placeAndCreate:

	# START: Draw Tetromino After Moving Down
	jal func_saveAllRegisters
	li $t5, 0 # Direction: Down
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Down
	jal func_saveAllRegisters
	jal func_checkAllRows
	jal func_loadAllRegisters

	move $a0, $v0
	jal func_scoreAdder
	
	jal func_saveAllRegisters
	li $t2, SCORE_START_X # x to draw
	li $t3, SCORE_START_Y # y to draw
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	addi $sp, $sp, -8
	jal func_scoreTracker
	jal func_loadAllRegisters
	
	
	li $s5, 1
	la $s6, hold_boolean
	sw $s5, 0($s6)

	jal func_saveAllRegisters
	jal func_spawn_new_tetromino
	jal func_loadAllRegisters
	move $t5, $v0
	li $t2, SPAWN_X
	li $t3, SPAWN_Y
	
	
	# CHECK IF T5 IS BLUE TETROMINO, THEN WE NEED TO SPAWN IT AT SPAWN_X - 4
	la $s7, lightblue_tetromino_1
	bne $t5, $s7, skip_checkLightblue
		addi $t3, $t3, -4
	
	skip_checkLightblue:
	jal func_saveAllRegisters
	la $a0, void_tetromino
	move $a1, $t5
	
	jal func_checkOverlap
	
	jal func_loadAllRegisters
	
	beq $v0, 1, func_gameover
		
	jal func_predictAndDrawPrediction
	
	j afterMoveDown
	
func_gameover:
	jal func_saveAllRegisters
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	
	jal func_loadAllRegisters
	
	jal func_saveAllRegisters
	jal func_drawGrid
	jal func_loadAllRegisters
	
	jal func_saveAllRegisters
	jal func_drawGameOverScreen
	jal func_loadAllRegisters
	
	jal func_saveAllRegisters
	li $t2, GAMEOVER_SCORE_START_X
	li $t3, GAMEOVER_SCORE_START_Y
	sw $t2, -4($sp)
	sw $t3, -8($sp)
	addi $sp, $sp, -8
	jal func_scoreTracker
	jal func_loadAllRegisters
	
	la $t7, highscore
	lw $t7, 0($t7)
	blt $t9, $t7, gameover_while_loop
	la $t7, highscore
	sw $t9, 0($t7)
	
	li $v0, 1
	move $a0, $t9
	syscall  
	 
gameover_while_loop:
	lw $t4, 0xffff0000
	bne $t4, 1, gameover_while_loop	
	lw $t4, 0xffff0004
	beq $t4, 0x71, respond_to_q_gameover
	beq $t4, 0x72, respond_to_r_gameover
	
	j gameover_while_loop
	
respond_to_q_gameover: 
	j main 
respond_to_r_gameover:
	j restartGame 
end_gameover_while_loop:
	
end_func_gameover:

func_drawGameOverScreen:
	li $t8, 0 #y
	li $t7, 0 #x
	la $t0, screen_gameover
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, WIDTH
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	#store the current pc
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	jal func_saveAllRegisters
	li $t0, 6
	sw $t0, -4($sp)
	addi $sp, $sp, -4
	jal func_drawDarkenScreen
	jal func_loadAllRegisters
	
	for_loop_gameover_i:
		# address is (j,i)
		li $t7, 0
		# y = y + 1
		li $t2, 0
	for_loop_gameover_j: 
		mult $t1, $t4 # i*25
		mflo $t3 # store in $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3 # store in $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]
		
		# SKIP COLOR IF 0X00000000
		beq $t5, 0x00000000, skip_gameover
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		li $a2, BASE_ADDRESS
		
		jal func_gotoxy

		# draw to $v0
		sw $t5, 0($v0)
			
		skip_gameover:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1 # j = j + 1
		blt $t2, $t4, for_loop_gameover_j
	end_loop_gameover_j:
	#change the y = y + 1
	addi $t8, $t8, 1
	#change i = i + 1
	addi $t1, $t1, 1
	blt $t1, HEIGHT, for_loop_gameover_i
	end_loop_gameover_i:
	
	#put the before pc to ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
end_func_drawGameOverScreen:
func_checkAllRows:
	li $t0, 0 #x
	
	li $t1, GRID_HEIGHT_BLOCK #y
	addi $t1, $t1, -1 #TRUST ME THIS IS CORRECT
	li $t2, 0 #counter
	
	sw $ra, -4($sp)
	addi $sp, $sp, -4
