	loop_end_checkAllRows_x:
	#only goes here if it complete row:
	
	complete_row:
	# complete row + 1
	addi $t2, $t2, 1
	li $v0, 4
	la $a0, newline
	syscall
	li $v0, 4
	la $a0, debug_completerow
	syscall
	#jump somewhere
	
	jal func_saveAllRegisters
	j end_of_checking_completeness

	incomplete_row:
	jal func_saveAllRegisters
	# a0 stores how much to drop
	# a1 y coordinate to start dropping
	move $a0, $t2 # Pass the counter
	move $a1, $t1
	bgt $t2, 0, func_dropAndDrawRow
end_of_checking_completeness:
	jal func_loadAllRegisters
	
	# HANDLE MUSIC
	jal func_saveAllRegisters
	jal func_handleMusic
	jal func_loadAllRegisters
	
	addi $t1, $t1, -1
	bge $t1, 0, loop_start_checkAllRows_y

loop_end_checkAllRows_y:
	move $v0, $t2 # USED FOR SCORE: The return value iof this function is number of rows

	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

func_deleteRow:
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	jal func_saveAllRegisters
	#give arguments
	jal func_loadAllRegisters
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
func_dropAndDrawRow:
	# a0 stores how much to drop
	# a1 y coordinate to start dropping
	
	li $t0, 0 #x
	move $t1, $a1 #y
	move $t2, $a0 #counter
	li $t5, 0
	
	li $a0, 0 # a0= x coordinate
	# a1 is already y coordinate
	jal func_gotoxyFromGrid
	
	#sw $s7, 0($v0)
	move $t3, $v0 #address of the top-left block in screen
	
	# a0 = 0
	# a1 = a1 + counter
	li $a0, 0
	move $a1, $t1
	add $a1, $a1, $t2
	jal func_gotoxyFromGrid
	move $t4, $v0 #address of the top-left block in screen

start_loop_dropAndDrawRow_y:
	
	li $t0, 0
	start_loop_dropAndDrawRow_x:
	# index = ADDRES + ((i * WIDTH) + x) * 4
		li $t8, WIDTH
		mult $t5, $t8
		mflo $t9
		
		li $t8, 4
		add $t9, $t9, $t0
		mult $t9, $t8
		mflo $t9
		
	# load from row A
		add $t7, $t3, $t9
		lw $t8, 0($t7)
	# store to row B
		add $t7, $t4, $t9
		sw $t8, 0($t7)
	
	addi $t0, $t0, 1
	blt $t0, GRID_WIDTH, start_loop_dropAndDrawRow_x
	end_loop_dropAndDrawRow_x:	
	
	addi $t5, $t5, 1
	blt $t5, TETROMINO_BLOCK_SIZE, start_loop_dropAndDrawRow_y
end_loop_dropAndDrawRow_y:
	
	bne $t1, 0, end_func_dropAndDrawRow
	
# Reset the last $t2 (counter) row as all the bblock inside has been dropped
loop_dropLastCounterRow:

	# if y == 0, then reset the row to grid
	li $t0, 0 #j
	move $a1, $t1 
	li $t5, 0 #i
	
	li $a0, 0 # a0= x coordinate
	move $a1, $t1
	jal func_gotoxyFromGrid
	#sw $s7, 0($v0)
	move $t3, $v0 #address of the top-left block in screen
	
	# a0 = 0
	# a1 = a1 + counter
	li $a0, 0
	move $a1, $t1
	# a1 is already y coordinate
	jal func_gotoxyFromBaseGrid
	move $t4, $v0 #address of the top-left block in screen
	
	start_loop_dropAndDrawLastRow_y:
	li $t0, 0
	start_loop_dropAndDrawLastRow_x:
	# index = ADDRES + ((i * WIDTH) + x) * 4
		li $t8, WIDTH
		mult $t5, $t8
		mflo $t9
		
		li $t8, 4
		add $t9, $t9, $t0
		mult $t9, $t8
		mflo $t9
	
	
	# load from row Base
		add $t7, $t4, $t9
		lw $t8, 0($t7)
	# store to row A
		add $t7, $t3, $t9
		sw $t8, 0($t7)
	
	addi $t0, $t0, 1
	blt $t0, GRID_WIDTH, start_loop_dropAndDrawLastRow_x
	end_loop_dropAndDrawRLastRow_x:	
	
	addi $t5, $t5, 1
	blt $t5, TETROMINO_BLOCK_SIZE, start_loop_dropAndDrawLastRow_y
	end_loop_dropAndDrawLastRow_y:
	
	addi $t1, $t1, 1
	blt $t1, $t2, loop_dropLastCounterRow
end_func_dropAndDrawRow:
	
j end_of_checking_completeness

# SCORE
func_scoreTracker:
	li $t1, 10000000  #used to divide
	lw $t3, 0($sp)
	lw $t2, 4($sp)
	addi $sp, $sp, 8
	
	# $t9 is score, move it to $t5
	move $t5, $t9
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	li $t7, 10 # Use to divide
	li $t9, 0 # for for loop until NUM_OF_DIGITS
for_start_drawNextDigit:
	# Process
	# 1st digit
	div $t5, $t1
	mfhi $t5 #remaining score
	mflo $t4 #draw this
	
	move $a0, $t2
	move $a1, $t3
	move $a2, $t4
	jal func_saveAllRegisters
	jal func_drawDigit
	jal func_loadAllRegisters
	#draw the $t4 with coordinates $t2, $t3
	addi $t2, $t2, 6
	
	# Divide the divider by 10
	div $t1, $t7
	mflo $t1
	# Increment for loop
	addi $t9, $t9, 1
	blt $t9, NUM_OF_DIGITS, for_start_drawNextDigit
for_end_drawNextDigit:	

	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
func_drawDigit:
	#a0, x
	#a1, y
	#a2, digit to draw
	
	move $t4, $a2
	beq $t4, 0, func_digit_0
	beq $t4, 1, func_digit_1
	beq $t4, 2, func_digit_2
	beq $t4, 3, func_digit_3
	beq $t4, 4, func_digit_4
	beq $t4, 5, func_digit_5
	beq $t4, 6, func_digit_6
	beq $t4, 7, func_digit_7
	beq $t4, 8, func_digit_8
	beq $t4, 9, func_digit_9
	
func_digit_0:
	la $a2, score_digit0
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_1:
	la $a2, score_digit1
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_2:
	la $a2, score_digit2
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_3:
	la $a2, score_digit3
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_4:
	la $a2, score_digit4
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigitv
func_digit_5:
	la $a2, score_digit5
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_6:
	la $a2, score_digit6
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_7:
	la $a2, score_digit7
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_8:
	la $a2, score_digit8
	j func_drawDigitToScreenAndGp
	# Will go back to end_func_drawDigit
func_digit_9:	
	la $a2, score_digit9
	j func_drawDigitToScreenAndGp 
	# Will go back to end_func_drawDigit
end_func_drawDigit:
	jr $ra	

func_drawDigitToScreenAndGp:

	move $t7, $a0 #x
	move $t8, $a1 #y
	move $t0, $a2 # address of tetromino array
	
	# Store x so that we can reset it inside the for loop
	sw $t7,-4 ($sp)
	addi $sp, $sp, -4
	
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, SCORE_DIGIT_WIDTH
	li $t9, 4 #4
	
	for_loop_digit_draw_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		li $t2, 0
	for_loop_digit_draw_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*SCORE_DIGIT_WIDTH + j
		mult $t3, $t9 #(i*SCORE_DIGIT_WIDTH + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		lw $t5, 0($t5)# t5 = arr[index]
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2, screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2, BASE_ADDRESS 
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		
		# -------------------------- Increment value for-loop-j
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, SCORE_DIGIT_WIDTH, for_loop_digit_draw_j
	end_loop_digit_draw_j:
	
	
	# -------------------- Increment value for-loop-j
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, SCORE_DIGIT_HEIGHT, for_loop_digit_draw_i
	end_loop_digit_draw_i:
	
	addi $sp, $sp, 4
	j end_func_drawDigit
end_func_digit_draw:



