func_drawMiniBlockatXY:
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, MINI_TETROMINO_SIZE
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	for_loop_drawMiniBlockatXY_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		
		li $t2, 0
	for_loop_drawMiniBlockatXY_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		
		beq $t5, 0x00000000, end_loop_drawMiniBlockatXY_i
		lw $t5, 0($t5)# t5 = arr[index]
		beq $t5, SKIP_COLOR, skip_drawMiniBlockatXY
		beq $t5, SKIP_COLOR_2, skip_drawMiniBlockatXY
		beq $t5, 0x00000000, skip_drawMiniBlockatXY
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		move $a2, $t6
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		# check value of v0
		lw $s7, 0($v0)
		
		beq $s7, 0xffffffff, skip_drawMiniBlockatXY
		beq $s7, 0xff5d5d5d, skip_drawMiniBlockatXY
		# draw to $v0
		sw $t5, 0($v0)
	skip_drawMiniBlockatXY:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, $t4, for_loop_drawMiniBlockatXY_j
	end_loop_drawMiniBlockatXY_j:
	
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, $t4, for_loop_drawMiniBlockatXY_i
	end_loop_drawMiniBlockatXY_i:
	
	addi $sp, $sp, 4
	jr $ra
end_func_drawMiniBlockatXY:
	
func_deleteMiniBlockatXY:
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	blt $t8,0, end_loop_deleteMiniBlockatXY_i
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, MINI_TETROMINO_SIZE
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	for_loop_deleteMiniBlockatXY_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		li $t2, 0
	for_loop_deleteMiniBlockatXY_j: 
		
		
	
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		move $a2, $t6
		
		jal func_gotoxy
		
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		# check value of v0
		lw $s7, 0($v0)
		beq $s7, 0xffffffff, skip_deleteMiniBlockatXY
		
		beq $s7, 0xff5d5d5d, skip_deleteMiniBlockatXY
		# draw to $v0
		li $t5, 0x00000000
		sw $t5, 0($v0)
		
		
	skip_deleteMiniBlockatXY:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, $t4, for_loop_deleteMiniBlockatXY_j
	end_loop_deleteMiniBlockatXY_j:
	
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, $t4, for_loop_deleteMiniBlockatXY_i
	end_loop_deleteMiniBlockatXY_i:
	
	addi $sp, $sp, 4
	jr $ra
end_func_deleteMiniBlockatXY:

func_drawScreenFromArray:
	# Takes a0 as source of screen (pause screen address)
	li $t8, 0 #y
	li $t7, 0 #x
	move $t0, $a0
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, WIDTH
	li $t6, BASE_ADDRESS
	li $t9, 4 #4
	
	#store the current pc
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	for_loop_drawScreenFromArray_i:
		# address is (j,i)
		li $t7, 0
		# y = y + 1
		li $t2, 0
	for_loop_drawScreenFromArray_j: 
		mult $t1, $t4 # i*25
		mflo $t3 # store in $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3 # store in $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]
		
		# SKIP COLOR IF 0X00000000
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		li $a2, BASE_ADDRESS
		
		jal func_gotoxy
		
	
		# draw to $v0
		sw $t5, 0($v0)
		
				
		skip_drawScreenFromArray:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1 # j = j + 1
		blt $t2, $t4, for_loop_drawScreenFromArray_j
	end_loop_ScreenFromArray_j:
	#change the y = y + 1
	addi $t8, $t8, 1
	#change i = i + 1
	addi $t1, $t1, 1
	blt $t1, HEIGHT, for_loop_drawScreenFromArray_i
	end_loop_ScreenFromArray_i:
	
	#put the before pc to ra
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
end_func_ScreenFromArray:

func_showMenu:
	
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	# Draw Menu Screen
	jal func_saveAllRegisters
	la $a0, screen_menu
	jal func_drawScreenFromArray
	jal func_loadAllRegisters
	
	
	#t0: number_of_tetromino in main screen (max 5)
	#t7: counter for minimum y difference between each tetromino
	li $t0, 0
	li $t7, 0
	li $s0, 0
	# START WHILE -----------------------------------------------------
	startWhile_drawMenuScreen:
	
	
	li $t1, 0 # Loop counter strat from 0
	la $t2, mini_tetrominos
	la $t3, mini_startX
	la $t4, mini_startY
	# START LOOP ------------------------------------
	loop_drawBlocksAtMenuScreen:
	bge $t1, $t0, skip_drawBlocksAtMenuScreen
	
	
	jal func_saveAllRegisters
	jal func_handleMusicForMain
	jal func_loadAllRegisters
	
	# Update y of each array (Y = Y + 1)
	lw $t6, 0($t4)
	addi $t6, $t6, 1
	sw $t6, 0($t4)
	
	
	jal func_saveAllRegisters
	lw $t3, 0($t3) # Get x from array
	lw $t4, 0($t4) # Get y from array
	lw $t5, 0($t2) # Get address from array
	addi $t4, $t4, -1
	sw $t3, -4($sp) #x
	sw $t4, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteMiniBlockatXY
	jal func_loadAllRegisters
	
	lw $t6, 0($t4)
	bge $t6, MAIN_SCREEN_LAST_Y, respawn
	
	jal func_saveAllRegisters
	lw $t3, 0($t3) # Get x from array
	lw $t4, 0($t4) # Get y from array
	lw $t5, 0($t2) # Get address from array
	sw $t3, -4($sp) #x
	sw $t4, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawMiniBlockatXY
	jal func_loadAllRegisters
	
	# Check if y is greater and SPAWN new one above
	blt $t6,MAIN_SCREEN_LAST_Y, skip_respawn
	
	

	# RESPAWN --------------------------------------------------
	respawn:
	# Every ,ultiple of 5 we can spawn one
	blt $t7, MINI_TETROMINO_SIZE, skip_respawn
	
	
	li $a0, 0
	li $a1, MINI_TETROMINO_SPAWN_CHANCE
	jal func_getRandomInteger
	bne $v0, 1, skip_respawn
	# Reset counter
	li $t7, 0

	# 11% Chance to Spawn Tetromino
	jal func_getRandomMiniTetromino
			
	# Store v0: random tetromino adress to stack t2
	sw $v0, 0($t2)
	# Store randomX to startX
	# Store 0 to startY
	# getRandom(48) + 5 so min is 5 and max is 53
	li $a0, 0
	li $a1, WIDTH
	addi $a1, $a1, -16
	jal func_getRandomInteger
	addi $v0, $v0, 5
	
	# Store startX to array
	sw $v0, 0($t3)
	li $t9, 1
	# Store startY to array
	sw $t9, 0($t4)
	# END RESPAWN -----------------------------------
	
	skip_respawn:
	addi $t2, $t2, 4 # INcrement array pointer 
	addi $t3, $t3, 4 # INcrement array pointer 
	addi $t4, $t4, 4 # INcrement array pointer 
	addi $t1, $t1, 1 # Increment Loop Counter
	j loop_drawBlocksAtMenuScreen
	skip_drawBlocksAtMenuScreen:
	# END LOOP --------------------------------------
	
	# Check if $t0 < MAXNUM_TETROMINO_ON_MENU
	# If yes, then have chance to generate one tetromino on at (x,1), x is random
	bge $t0, MAXNUM_TETROMINO_ON_MENU, skip_spawnTetromino
	blt $t7, MINI_TETROMINO_SIZE, skip_spawnTetromino

	li $a0, 0
	li $a1, MINI_TETROMINO_SPAWN_CHANCE
	jal func_getRandomInteger
	bne $v0, 1, skip_spawnTetromino
		# Reset counter
	li $t7, 0
	
	# Successfully generate a tetromino
	addi $t0, $t0, 1
	jal func_getRandomMiniTetromino
			
	# Store v0: random tetromino adress to stack t2
	sw $v0, 0($t2)
	# Store randomX to startX
	# Store 0 to startY
	# getRandom(48) + 5 so min is 5 and max is 53
	li $a0, 0
	li $a1, WIDTH
	addi $a1, $a1, -16
	jal func_getRandomInteger
	addi $v0, $v0, 5
	
	# Store x of new tetromino to array
	sw $v0, 0($t3)
	li $t9, 1
	# Store y of new tetromino to array
	sw $t9, 0($t4)
	skip_spawnTetromino:
	
	# ADD COUNTER 
	addi $t7, $t7, 1

	
	# Every While Check for Keypress
	lw $t8, 0xffff0000
	bne $t8, 1, end_keypress_drawMenuScreen	
	lw $t8, 0xffff0004 # this assumes $t4 is set to 0xfff0000 from before
	
	beq $t8, 0x73, end_while_drawMenuScreen
	beq $t8, 0x71, end
	end_keypress_drawMenuScreen:
	
	
	li $a0, 1
	li $v0, 32
	syscall
	j startWhile_drawMenuScreen
	end_while_drawMenuScreen:
	# END WHILE ---------------------------------------------------------
	
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
end_showMenu:


# This function return v0: x predicxt, v1: y predict
func_getPredictionXY:
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	jal func_saveAllRegisters
	
loop_getPredictionXY_start:
	# HANDLE MUSIC

	jal func_saveAllRegisters
	jal func_handleMusic
	jal func_loadAllRegisters
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters

	# START - CHECK IF BOTTOM COLLIDE
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_checkCollisionBottom
	jal func_loadAllRegisters
	

	bne $v0, 1, predict_Next
	
	# IF COLLIDE, THEN
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	addi $sp, $sp, -8
	j loop_getPredictionXY_end
	
	predict_Next:
	# START - DELETE THE BLOCK
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	# END
	
	
	addi $t3, $t3, TETROMINO_BLOCK_SIZE

	j loop_getPredictionXY_start
	
loop_getPredictionXY_end:
	# START - DELETE THE BLOCK
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	
	
	# END
	lw $v1, 0($sp)
	lw $v0, 4($sp)
	addi $sp, $sp, 8
	
	jal func_loadAllRegisters
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
	
func_drawPreviewBlockatXY:
	lw $t0, 0($sp) # address of tetromino array
	lw $t8, 4($sp) #y
	lw $t7, 8($sp) #x
	addi $sp, $sp, 8
	
	li $t1, 0 # i 
	li $t2, 0 # j
	li $t3, 0 # index
	li $t4, TETROMINO_SIZE
	la $t6, screen
	li $t9, 4 #
	li $s3, 3
	for_loop_drawPreviewBlock_i:
		# address is (j,i)
		lw $t7, 0($sp)
		# y = y + 1
		li $t2, 0
	for_loop_drawPreviewBlock_j: 
		
		mult $t1, $t4
		mflo $t3
		add $t3, $t3, $t2 # i*25 + j
		mult $t3, $t9 #(i*25 + j) * 4
		mflo $t3
		add $t5, $t0, $t3 # t5 = address of arr[index]
		lw $t5, 0($t5)# t5 = arr[index]
		# ---------------- DARKEN T5 -------------------
		# Load the original color into a register
   		andi $s4, $t5, 0xFF000000
		andi $s5, $t5, 0x00FF0000
		andi $s6, $t5, 0x0000FF00
		andi $s7, $t5, 0x000000FF
		
		# Shift right to get the RR, GG, BB
		srl $s5, $s5, 16
		srl $s6, $s6, 8
		
		# RR/2, GG/2, BB/2
		div $s5, $s3
		mflo $s5
		
		div $s6, $s3
		mflo $s6
		
		div $s7, $s3
		mflo $s7
		
		# Shift left RR, GG, BB to original position
		sll $s5, $s5, 16
		sll $s6, $s6, 8
		
		# Or to combine
		or $s4, $s4, $s5
		or $s4, $s4, $s6
		or $s4, $s4, $s7
		
		# t5 = new color
		move $t5, $s4
		# ---------------- END_DARKEN T5 -------------------
	
		beq $t5, SKIP_COLOR, skip_drawPreviewBlock
		beq $t5, SKIP_COLOR_2, skip_drawPreviewBlock
		# arguments to gotoxy
		move $a0, $t7 #x
		move $a1, $t8 #y
		la $a2,screen 
		sw $ra, -4($sp)
		addi $sp, $sp, -4
		
		jal func_gotoxy
		
		# draw to $v0
		sw $t5, 0($v0)
		
		lw $ra, 0($sp)
		addi $sp, $sp, 4
	skip_drawPreviewBlock:
		addi $t7, $t7, 1 # x = x + 1
		addi $t2, $t2, 1
		blt $t2, $t4, for_loop_drawPreviewBlock_j
	end_loop_drawPreviewBlock_j:
	
	addi $t8, $t8, 1
	addi $t1, $t1, 1
	blt $t1, $t4, for_loop_drawPreviewBlock_i
	end_loop_drawPreviewBlock_i:
	
	addi $sp, $sp, 4
	jr $ra
end_func_drawPreviewBlock:

func_predictAndDrawPrediction:
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	
	jal func_getPredictionXY

	
	# SAVE V0 V1 TO STACK CAUSE I WANT TO USE IT IN THE NEXT FUNCTION
	sw $v0, -4($sp) #x
	sw $v1, -8($sp) #y
	addi $sp, $sp, -8
	
	jal func_saveAllRegisters
	sw $v0, -4($sp) #x
	sw $v1, -8($sp) #y
	sw $t5, -12($sp) # address of tetromino array
	addi $sp, $sp, -12
	jal func_drawPreviewBlockatXY
	jal func_loadAllRegisters
	
	
	lw $v1, 0($sp)
	lw $v0, 4($sp)
	jal func_saveAllRegisters
	la $t1, prediction_startX
	la $t2, prediction_startY
	sw $v0, 0($t1)
	sw $v1, 0($t2)
	jal func_loadAllRegisters
	# START: Draw Tetromino Prediction On Screen
	jal func_saveAllRegisters
	li $t5, 69  # Direction: None
	sw $v0, -4($sp) #x
	sw $v1, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino Prediction On Screen
	
	
	lw $v1, 0($sp)
	lw $v0, 4($sp)
	addi $sp, $sp, 8
	
	# START: Delete Tetromino Prediction On Abstract Screen
	jal func_saveAllRegisters
	sw $v0, -4($sp) #x
	sw $v1, -8($sp) #y
	sw $t5, -12($sp) # address of tetromino array
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
func_deletePrediction:
	sw $ra, -4($sp)
	addi $sp, $sp, -4
	
	jal func_saveAllRegisters
	la $t1, prediction_startX
	la $t2, prediction_startY
	lw $t1, 0($t1)
	lw $t2, 0($t2)
	
	# START - DELETE THE BLOCK
	
	jal func_saveAllRegisters
	sw $t1, -4($sp) #x
	sw $t2, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	# END
	
	# START: Draw Tetromino Prediction On Screen
	jal func_saveAllRegisters
	li $t5, 69  # Direction: None
	sw $t1, -4($sp) #x
	sw $t2, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino Prediction On Screen
	
	
	jal func_loadAllRegisters
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

# a0: counter now
func_handleMusic:
	
	li $t9, 0 #index
	li $t8, 0 #offset for duration and timetoplay
	la $t7, lst_of_pitch
	la $t1, lst_of_duration 
	la $t2, lst_of_timetoplay
	move $a0, $s0

	for_linear_search:

	add $t3, $t7, $t9
	add $t4, $t1, $t8
	add $t5, $t2, $t8
	lb $t3, 0($t3)
	lw $t4, 0($t4)
	lw $t5, 0($t5) #time to play

	
	bne $a0, $t5, not_this_one
	move $a0, $t3
	move $a1, $t4
	li $a2, INSTRUMENT #INSTRUMENT
	li $a3, VOLUME #VOLUME
	li $v0, 31
	syscall 
	

	j end_linear_search
	not_this_one:
	addi $t9, $t9, 1
	addi $t8, $t8, 4
	blt $t9, 150, for_linear_search
	end_linear_search:
	
	
	
	# Add counter
	li $s7, FRAME_COUNTER_MOD
	addi $s0, $s0, 1
	div $s0, $s7
	mfhi $s0
	jr $ra
func_handleMusicForMain:
	
	li $t9, 0 #index
	li $t8, 0 #offset for duration and timetoplay
	la $t7, lst_of_pitch
	la $t1, lst_of_duration 
	la $t2, lst_of_timetoplay_for_main
	move $a0, $s0

	for_linear_search_main:

	add $t3, $t7, $t9
	add $t4, $t1, $t8
	add $t5, $t2, $t8
	lb $t3, 0($t3)
	lw $t4, 0($t4)
	lw $t5, 0($t5) #time to play

	
	bne $a0, $t5, not_this_one_main
	move $a0, $t3
	move $a1, $t4
	li $a2, INSTRUMENT #INSTRUMENT
	li $a3, VOLUME #VOLUME
	li $v0, 31
	syscall 
	

	j end_linear_search_main
	not_this_one_main:
	addi $t9, $t9, 1
	addi $t8, $t8, 4
	blt $t9, 150, for_linear_search_main
	end_linear_search_main:
	
	
	
	# Add counter
	li $s7, FRAME_COUNTER_MOD_FOR_MAIN
	addi $s0, $s0, 1
	div $s0, $s7
	mfhi $s0
	jr $ra	
main:
	# REMOVE THIS COMMENT ----------- REMOVE THIS COMMENT ------------------------- REMOVE THIS COMMENTY
	jal func_showMenu

after_menu:


	#jal func_drawBlockatXY

restartGame:
	jal func_drawScreenBase

# $t0 is a counter for frame % FRAME_COUNTER_MOD
# $t1 
# $t2 is the startX of the active tetromino
# $t3 is the startY of the active tetromino
# $t4 is keyboard ut
# $t5 is address of tetromino
# $t6 is hold
# $t7 maybe is used in highschore
# $t8 is level
# $t9 is mfhi to check gravity moves block or not
jal func_highscoreTracker
jal func_saveAllRegisters
jal func_drawScreen
jal func_loadAllRegisters

li $s0, 0
li $t0, 0
li $t1, GRAVITY
li $t2, SPAWN_X
li $t3, SPAWN_Y
li $t6, 0
li $t8, 1 #gravity level
li $t9, 0 #score
# GET RANDOM TETROMINO ------------------------------
jal func_saveAllRegisters
jal func_create_5_tetrominos
jal func_loadAllRegisters


jal func_saveAllRegisters
jal func_spawn_new_tetromino
jal func_loadAllRegisters

move $t5, $v0

	jal func_predictAndDrawPrediction
start:	
	
	# START: Check for input
	lw $t4, 0xffff0000
	bne $t4, 1, end_keypress	
	lw $t4, 0xffff0004 # this assumes $t4 is set to 0xfff0000 from before
	beq $t4, 0x61, respond_to_a # ASCII code of 'a' is 0x61 or 97 in decimal 
	beq $t4, 0x64, respond_to_d
	beq $t4, 0x73, respond_to_s
	beq $t4, 0x77, respond_to_w
	beq $t4, 0x20, respond_to_space
	beq $t4, 0x68, respond_to_h
	beq $t4, 0x70, respond_to_p
	beq $t4, 0x71, respond_to_q
	# END: Check for input
	
end_keypress:	
	# Delay (second per frame)
	
	# START: Draw Tetromino on Abstract Screen
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	
	
	# START: Draw Tetromino After Moving Down
	jal func_saveAllRegisters
	li $t5, 0 # Direction: Down
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Down
	
	#jal func_saveAllRegisters
	#jal func_drawDigit
	#jal func_loadAllRegisters
	# $t9 = COUNTER % GRAVITY, $t0 is counter, $t1 gravity
	div $t0, $t1
	mfhi $s7
	
	bne $s7, 0, afterMoveDown
	# START - CHECK IF BOTTOM COLLIDE
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_checkCollisionBottom
	jal func_loadAllRegisters
	beq $v0, 1, func_placeAndCreate
	# END - CHECK IF BOTTOM COLLIDE
	
	# START - DELETE THE BLOCK
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_deleteBlockatXY
	jal func_loadAllRegisters
	# END
	
	addi $t3, $t3, TETROMINO_BLOCK_SIZE
	
	
	# START: Draw Tetromino on Abstract Screen
	jal func_saveAllRegisters
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Tetromino After Moving Down
	jal func_saveAllRegisters
	li $t5, 0 # Direction: Down
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Tetromino After Moving Down
	
	# START: Draw Joystick on Abstract Screen
	jal func_saveAllRegisters
	la $t5, joystick
	li $t2, JOYSTICK_STARTX
	li $t3, JOYSTICK_STARTY
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp) #address of tetromino
	addi $sp, $sp, -12
	jal func_drawBlockatXY
	jal func_loadAllRegisters
	# END: Draw Tetromino On Abstract Screen
	
	# START: Draw Joystick After Moving Down
	jal func_saveAllRegisters
	li $t5, 69 # Direction: None
	li $t2, JOYSTICK_STARTX
	li $t3, JOYSTICK_STARTY
	
	sw $t2, -4($sp) #x
	sw $t3, -8($sp) #y
	sw $t5, -12($sp)
	addi $sp, $sp, -12
	jal func_drawTetrominoAfterMoveOnScreen
	jal func_loadAllRegisters
	# END: Draw Joystick After Moving Down
afterMoveDown: 
	jal func_saveAllRegisters
	jal func_handleMusic
	jal func_loadAllRegisters
	jal delay
	j start

jal func_drawScreen

end: 
li $v0, 10 # terminate the program gracefully
syscall




